import React, { Component } from 'react';
import Portal from '../Common/portal'

class DoctorsPortal extends Component {
    render() {
      var data = localStorage.getItem("patient");
      var data2 = JSON.parse(data);
      var name="";
      //var detials=JSON.parse( data2.data)
      var i = "";
      for (i in data2.data) {
        name=data2.data[i].fname;
        name += " "+data2.data[i].lname;
        console.log(name);
      }
        return (
          <div>
          <Portal 
          PortalName="Patient Portal"
          SideBarName="Dashboard"
          PersonName={name}
          portallink="/patientportal"
          
          // Heading 01
          mainoption1="Report"

          smalloption1="View Report"

          showOption2="true"
          smalloption2="View History"

          showOption3=""
          smalloption3=""

          // Heading 02
          mainoption2="Manage Account"

          showOption4="true"
          smalloption4="Account Details"

          showOption5=""
          smalloption5=""

          showOption6=""
          smalloption6=""



          // Heading 03
          mainoption3=""
         
          showOption7=""
          smalloption7=""

          showOption8=""
          smalloption8=""
         

        //   Add Doc-Patient
        addpatdoc=""
        addtype="Doctor"

       //  Delete Doc-Patient
       delpatdoc="true"

       // History Doc-Patient
       history1=""
          />
         
         </div>
        );}
 }
                           
export default DoctorsPortal;
